let initialState = {
  friends: [
    { id: 8, name: 'Mia', avatar: 'luffyAvatar.png', },
    { id: 9, name: 'Kaya', avatar: 'avatar1.png', },
    { id: 10, name: 'Zizi', avatar: 'avatar2.png', },
  ]
}

const navbarReducer = (state = initialState, action) => {
  return state;
}

export default navbarReducer;
